import React, { Component } from 'react'
import Config from '../../Utils/Config';
import './index.scss';

export class Sidebar extends Component {
    render() {
        return (
            <div className="__sidebar">

                <div className="__sidebar_logo">
                    <img src={Config.logo} alt="" />
                </div>
                <h1>Sidebar</h1>
            </div>
        )
    }
}

export default Sidebar
